import React, { Component } from "react";
import { Link, withRouter } from "react-router-dom";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { registerUser } from "../../actions/authAutentications";
import classnames from "classnames";

class Register extends Component {
  constructor() {
    super();
    this.state = {
      name: "",
      cognome: "",
      cf: "",
      sesso: "",
      luogo_nascita: "",
      provincia_nascita: "",
      patente: "",
      email: "",
      password: "",
      password2: "",
      errors: {}
    };
  }

  componentDidMount() {
    // If logged in and user navigates to Register page, should redirect them to dashboard
    if (this.props.auth.isAuthenticated) {
      this.props.history.push("/dashboard");
    }
  }

  componentWillReceiveProps(nextProps) {
    if (nextProps.errors) {
      this.setState({
        errors: nextProps.errors
      });
    }
  }

  onChange = e => {
    this.setState({ [e.target.id]: e.target.value });
  };

  onSubmit = e => {
    e.preventDefault();

    const newUser = {
      name: this.state.name,
      cognome: this.state.cognome,
      cf: this.state.cf,
      sesso: this.state.sesso,
      luogo_nascita: this.state.luogo_nascita,
      provincia_nascita: this.state.provincia_nascita,
      patente: this.state.patente,
      email: this.state.email,
      password: this.state.password,
      password2: this.state.password2
    };

    this.props.registerUser(newUser, this.props.history);
  };

  render() {
    const { errors } = this.state;

    return (
      <div className="container">
        <div className="row">
          <div className="col s8 offset-s2">
            <Link to="/" className="btn-flat waves-effect">
              <i className="material-icons left">keyboard_backspace</i> Back to
              home
            </Link>
            <div className="col s12" style={{ paddingLeft: "11.250px" }}>
              <h4>
                <b>Registrati</b> 
              </h4>
              <p className="grey-text text-darken-1">
                Already have an account? <Link to="/login">Log in</Link>
              </p>
            </div>
            <form noValidate onSubmit={this.onSubmit}>
              <div className="form-group">
              <label htmlFor="name">Nome</label>
                <input
                  onChange={this.onChange}
                  value={this.state.name}
                  error={errors.name}
                  id="name"
                  type="text"
                  className={classnames("", {
                    invalid: errors.name
                  })}
                />
                <span className="red-text">{errors.name}</span>
              </div>
              <div className="form-group">
              <label htmlFor="cognome">Cognome</label>
                <input
                  onChange={this.onChange}
                  value={this.state.cognome}
                  error={errors.cognome}
                  id="cognome"
                  type="text"
                  className={classnames("", {
                    invalid: errors.cognome
                  })}
                />
                <span className="red-text">{errors.cognome}</span>
              </div>
              <div className="form-group">
              <label htmlFor="cf">Codice Fiscale</label>
                <input
                  onChange={this.onChange}
                  value={this.state.cf}
                  error={errors.cf}
                  id="cf"
                  type="text"
                  className={classnames("", {
                    invalid: errors.cf
                  })}
                />
                <span className="red-text">{errors.cf}</span>
              </div>
              <div className="form-group">
                    <label>Sesso</label>
                    <select id="sesso" type="text" value={this.state.sesso} 
                    onChange={this.onChange} error={errors.sesso}
                    >
                    <option value="Uomo">Uomo</option>
                    <option value="Donna">Donna</option>
                    <option value="NaN">Non specifico</option>
                    </select>
                    <span className="red-text">{errors.sesso}</span>
                </div>
                <div className="form-group">
              <label htmlFor="luogo_nascita">Luogo di nascita</label>
                <input
                  onChange={this.onChange}
                  value={this.state.luogo_nascita}
                  error={errors.luogo_nascita}
                  id="luogo_nascita"
                  type="text"
                  className={classnames("", {
                    invalid: errors.luogo_nascita
                  })}
                />
                <span className="red-text">{errors.luogo_nascita}</span>
              </div>
              <div className="form-group">
              <label htmlFor="provincia_nascita">Provincia di nascita</label>
                <input
                  onChange={this.onChange}
                  value={this.state.provincia_nascita}
                  error={errors.provincia_nascita}
                  id="provincia_nascita"
                  type="text"
                  className={classnames("", {
                    invalid: errors.provincia_nascita
                  })}
                />
                <span className="red-text">{errors.provincia_nascita}</span>
              </div>
              <div className="form-group">
              <label htmlFor="patente">Numero Patente</label>
                <input
                  onChange={this.onChange}
                  value={this.state.patente}
                  error={errors.patente}
                  id="patente"
                  type="text"
                  className={classnames("", {
                    invalid: errors.patente
                  })}
                />
                <span className="red-text">{errors.patente}</span>
              </div>
              <div className="form-group">
              <label htmlFor="email">Email</label>
                <input
                  onChange={this.onChange}
                  value={this.state.email}
                  error={errors.email}
                  id="email"
                  type="email"
                  className={classnames("", {
                    invalid: errors.email
                  })}
                />
                <span className="red-text">{errors.email}</span>
              </div>
              <div className="form-group">
              <label htmlFor="password">Password</label>
                <input
                  onChange={this.onChange}
                  value={this.state.password}
                  error={errors.password}
                  id="password"
                  type="password"
                  className={classnames("", {
                    invalid: errors.password
                  })}
                />
                <span className="red-text">{errors.password}</span>
              </div>
              <div className="form-group">
              <label htmlFor="password2">Conferma Password</label>
                <input
                  onChange={this.onChange}
                  value={this.state.password2}
                  error={errors.password2}
                  id="password2"
                  type="password"
                  className={classnames("", {
                    invalid: errors.password2
                  })}
                />
                <span className="red-text">{errors.password2}</span>
              </div>
              <div className="col s12" style={{ paddingLeft: "11.250px" }}>
                <button
                  style={{
                    width: "150px",
                    borderRadius: "3px",
                    letterSpacing: "1.5px",
                    marginTop: "1rem"
                  }}
                  type="submit"
                  className="btn btn-large waves-effect waves-light hoverable blue accent-3"
                >
                  Registrati
                </button>
              </div>
            </form>
          </div>
        </div>
      </div>
    );
  }
}

Register.propTypes = {
  registerUser: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
  errors: PropTypes.object.isRequired
};

const mapStateToProps = state => ({
  auth: state.auth,
  errors: state.errors
});

export default connect(
  mapStateToProps,
  { registerUser }
)(withRouter(Register));
